export const methods = {
  onSubmit: 'getData',
};
export const samplePayload = { // sample payload used when the tool is not running in an iframe
  unitId: 'jobId_taskId_recordId_workId',
  mode: 'markup',
  // image: 'https://source.unsplash.com/random/',
  tools: ['square', 'box', 'polygon', 'circle', 'ellipse', 'point'],
  metadata: [
    {
      id: 'description',
      type: 'string',
      label: 'Description',
      required: true,
    },
  ],

  // support multi images
  image: 'https://appen-lidar-qa.s3.cn-northwest-1.amazonaws.com.cn/sample/1/image_00/data/0000000062.png, https://appen-lidar-qa.s3.cn-northwest-1.amazonaws.com.cn/sample/1/image_01/data/0000000062.png, https://appen-lidar-qa.s3.cn-northwest-1.amazonaws.com.cn/sample/1/image_02/data/0000000062.png, https://appen-lidar-qa.s3.cn-northwest-1.amazonaws.com.cn/sample/1/image_03/data/0000000062.png',
  sequenceData: [
    { entities: [] }
  ]
};
